import {
    MDBCarousel,
    MDBCarouselItem,
  } from 'mdb-react-ui-kit';

function Home()
{
    return(
        <>

    <MDBCarousel fade interval={2000} pause={false}>
      <MDBCarouselItem
        className='w-100 d-block'
        itemId={1}
        src='./uploads'
        alt='...'
      />
      <MDBCarouselItem
        className='w-100 d-block'
        itemId={2}
        src='https://static.businessworld.in/article/article_extra_large_image/1469101893_yNSqC0_PG.jpe'
        alt='...'
      />
      <MDBCarouselItem
        className='w-100 d-block'
        itemId={3}
        src='https://www.colive.com/blog/wp-content/uploads/2022/02/10-hacks-to-help-you-live-hassle-free-in-pg-rooms-803x420.jpg'
        alt='...'
      />
    </MDBCarousel>

        </>
    )
}

export default Home;
